@Component({
  selector: 'app-root',
  templateUrl: './app.component.html',
  styleUrls: ['./app.component.css']
})
export class AppComponent {
  title = 'online-news-portal';



  logout() : void {
    localStorage.removeItem('userId');
    localStorage.removeItem('username');
  }
}
